import React from 'react'
import { GlobalStyle, ActiveBtn } from './GlobalStyle'

const DefaultView = ({ children }) => {
    return (
        <div>
            <GlobalStyle />
            <div className="header">header</div>
            <div className="login-box">login-box</div>
            {children}
            <ActiveBtn>asdasd</ActiveBtn>
        </div>
    )
}

export default DefaultView;
